import React from 'react'
import style from './MealsItem.module.css'

const MealsItem = (props) => {
  return (
    <li key={props.key}>
      <div><h3>{props.name}</h3></div>
      <div><p>{props.description}</p><p>{props.price}</p></div>
    </li>
  )
}

export default MealsItem
